import styled from 'styled-components';
import Footer from '../../footer/Footer';
import Body from './body/Body';
import Nav from '../../nav/Nav';

const StyledContainer = styled.div`
`
const HomePage = () => {
    return (
        <div>
            <Nav />
            <StyledContainer>
                <Body />
            </StyledContainer>
                <Footer />
        </div>
    )
}
export default HomePage;
